function showPaymentModal2(paymentManagerInstance) {

    let modalBgStyle = "background: rgba(0, 0, 0, 0.5);" +
        "height: 100%;" +
        "position: absolute;" +
        "width: 100%;" +
        "top: 0%;" +
        "left: 0%;" +
        "z-index: 9998;";

    let parentDivStyle = "padding: 8px;" +
        "background: rgba(255,255,255,1);" +
        "top: 20%;" +
        "left: 10%;" +
        "width: 80%;" +
        "position: absolute;" +
        "resize: vertical;" +
        "border-radius: 4px;" +
        "color: rgba(255,255,255,1);" +
        "font-family: Helvetica;" +
        "font-size: 20px;" +
        "text-align: center;" +
        "z-index: 9999;";

    let titleStyle = "text-align: center;" +
        "font-weight: bold;" +
        "color: rgba(144,144,144,1);" +
        "margin-bottom: 4%;" +
        "margin-top: 4%;";

    if(window.innerHeight > window.innerWidth){
        titleStyle += "font-size: 6vh;";
    } else {
        titleStyle += "font-size: 6vw;";
    }



    let wrapperDivStyle = "padding-left: 32px;" +
        "padding-right: 32px;" +
        "text-align: center;" +
        "margin: 0 auto;" +
        "display: inline-block";


    let newDiv = "<div style='" + modalBgStyle + "' id='inapp_modal_bg'>" +
        "<div style='" + parentDivStyle + "'>" +
        // "<div style='" + wrapperDivStyle + "'>" +
        "<div style='" + titleStyle + "'>Select Payment Option</div>";

    let supportedPaymentTypes = paymentManagerInstance.getAllowedPaymentMethods();

    if (supportedPaymentTypes.length === 0) {
        return;
    } else if (supportedPaymentTypes.length === 1) {
        let deepUrl = manager.getDeepLinkUrl(payAppTypes["_$wrappers"][supportedPaymentTypes[0]].scheme);

        console.log(deepUrl);
        window.location.href = deepUrl;
        return;
    }

    for (let i = 0; i < supportedPaymentTypes.length; i++) {
        let payType = supportedPaymentTypes[i];
        newDiv += getDivForScheme(payType);
    }

    newDiv += "</div></div>";
    // newDiv += "</div></div></div>";

    document.body.insertAdjacentHTML("afterBegin", newDiv);
    document.body.focus();

    document.getElementById('inapp_modal_bg').onclick = function (e) {
        let modalBg = document.getElementById('inapp_modal_bg');
        let senderElement = e.target;
        if (senderElement === modalBg) {
            modalBg.parentNode.removeChild(modalBg);
        }
    };


    for(let i = 0; i < supportedPaymentTypes.length; i++){
        let payType = supportedPaymentTypes[i];
        addClickListener(payType, paymentManagerInstance)
    }
}

function addClickListener(payType, paymentManager) {
    let elementSuffix = '_selection_div';
    let paymentElementId = payAppTypes["_$wrappers"][payType].scheme + elementSuffix;

    document.body.focus();

    document.getElementById(paymentElementId).onclick = function (e) {
        let deepUrl = paymentManager.getDeepLinkUrl(payAppTypes["_$wrappers"][payType].scheme);

        console.log(deepUrl);
        window.location.href = deepUrl;
        let modalBg = document.getElementById('inapp_modal_bg');
        modalBg.parentNode.removeChild(modalBg);
    };
}

function getDivForScheme(payType) {
    let paymentLogo;
    let paymentElementId;
    let elementSuffix = '_selection_div';
    let paymentLabel;




    let childDivStyle = '';
    let imgStyle = '';

    if(window.innerHeight > window.innerWidth){
        childDivStyle += "padding: 8px;" +
            "color: rgba(64,64,64, 1);" +
            "font-family: Helvetica;" +
            "margin-bottom: 6%;" +
            "font-size: 5vh;" +
            "text-align: left;";
        imgStyle += "max-height: 8vh;" +
            "margin-right: 10%;" +
            "margin-left: 10%;" +
            "vertical-align: middle";
    } else {
        childDivStyle += "padding: 8px;" +
            "color: rgba(64,64,64, 1);" +
            "font-family: Helvetica;" +
            "margin-bottom: 6%;" +
            "font-size: 5vw;" +
            "text-align: left;";
        imgStyle += "max-height: 8vw;" +
            "margin-right: 10%;" +
            "margin-left: 20%;" +
            "vertical-align: middle";
    }


    switch (payType) {
        case quickstart.PayAppType.NETSPAY: {
            paymentLogo = netspayLogoEnabled;
            paymentElementId = payAppTypes["_$wrappers"][payType].scheme + elementSuffix;
            paymentLabel = 'NETSPay';
            break;
        }
        case quickstart.PayAppType.DBS_PAYLAH: {
            paymentLogo = DbsPaylahLogoEnabled;
            paymentElementId = payAppTypes["_$wrappers"][payType].scheme + elementSuffix;
            paymentLabel = 'DBS PayLah';
            break;
        }
        case quickstart.PayAppType.OCBC_PAYANYONE: {
            paymentLogo = OcbcPayAnyoneLogoEnabled;
            paymentElementId = payAppTypes["_$wrappers"][payType].scheme + elementSuffix;
            paymentLabel = 'OCBC PayAnyone';
            break;
        }
        case quickstart.PayAppType.UOB_MIGHTY: {
            paymentLogo = UobMightyLogoEnabled;
            paymentElementId = payAppTypes["_$wrappers"][payType].scheme + elementSuffix;
            paymentLabel = 'UOB Mighty';
            break;
        }
        default: {
            return '';
        }
    }

    return "<div style='" + childDivStyle + "' id='" + paymentElementId + "'>" +
        "<img src='" + paymentLogo + "' style='" + imgStyle + "'/>" +
        paymentLabel +
        "</div>";
}


